import React from 'react';
import Button from '@mui/material/Button';
import { red } from '@mui/material/colors';

function App() {
  return (
    <div>
      <Button variant="text">Text</Button>
      <Button variant="contained" sx={{
        background: "red",
        color: "#fff",
        "&:hover":{
          opacity: 0.5
        }
      }}>Contained</Button>
      <Button variant="outlined">Outlined</Button>
    </div>
  );
}

export default App;
